import React, { useState } from 'react';
import "./Navbar.css";

function Navbar(){

    const [currentState, setState] = useState('Home');

    function buttonHandler(newState) {
        setState(newState);  
        console.log(currentState);
    }

    return (
        <div className="div">
            <ul className="navbar">
                <li className="box"><button onClick={() => buttonHandler("home")}>Home</button></li>
                <li className="box"><button onClick={() => buttonHandler("bio")}>Bio</button></li>
                <li className="box"><button onClick={() => buttonHandler("education")}>Education</button></li>
                <li className="box"><button onClick={() => buttonHandler("projects")}>Projects</button></li>
                <li className="box"><button onClick={() => buttonHandler("professional")}>Professional</button></li>
            </ul>
            {currentState==="home" && <p>HOME</p>}
            {currentState==="bio" && <p>BIO</p>}
            {currentState==="home" && <p>EDUCATION</p>}
            {currentState==="bio" && <p>PROJECTS</p>}
            {currentState==="home" && <p>PROFESSIONAL</p>}
        </div>
    )
}

export default Navbar;
